Chính chủ cho thuê Phòng tại Nguyễn Khánh Toàn, gần LOTTE, Đào Tấn, Công Viên Thủ Lệ, Công viên Nghĩa Đô, Bảo Tàng Dân tộc học, VINCOM Liễu Giai, DEWOO, Chợ Dương Quảng Hàm, Bến xe Bus.
Phòng có sẵn Điều hòa (hai chiều), Nóng lạnh, Máy giặt, Gường, Đệm, Tủ, Bàn làm việc, Tủ lạnh, Lò vi sóng, Tivi, Wifi (nói chung full đồ, không thiếu gì) chỉ cần xách Vali vào ở. Không thể tìm phòng nào đầy đủ tiện nghi và rẻ hơn so với khu vực. Fr tiền nước, tiền mạng tháng đầu cho bạn nào vào ở ngay trong tuần này.
- Phòng Sàn gỗ; Có Phòng Khách chung hiện đại; Vệ sinh cao cấp, sạch sẽ;
- Có chỗ nấu ăn riêng, có Ban công thoáng đãng;
- Nhà yên tĩnh, sạch sẽ, riêng tư, giờ giấc tự do, KHÔNG CHUNG CHỦ;
- Có chỗ để xe miễn phí; Anh ninh tốt, có camera 24/24;
Giá: 3,x triệu. Cả nhà chỉ có 5 Phòng.
Địa chỉ: Số 41A, Ngách 225/7, Ngõ 48 Nguyễn Khánh Toàn, Cầu Giấy, Hà Nội.
Liên hệ chính chủ:  hoặc  (Mr.Phương). Nhà chính chủ, không tiếp môi giới hay bất động sản. 
